import React, { useEffect } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';  // Import useNavigate

const AdminViewSellers = () => {
    const location = useLocation();
    const responseData = location.state?.responseData;
    const navigate = useNavigate();

    useEffect(() => {
        const one = async () => {
            alert(responseData.token);
            // Example usage of navigate:
            navigate('/some-other-route');  // Replace with your desired route
        };
        one();
    }, [responseData, navigate]);  // Include responseData and navigate in the dependency array

    return (
        <div>al</div>
    );
};

export default AdminViewSellers;
